    const tl = gsap.timeline({
      defaults: { ease: "power2.out" },
    });

    // Main title animation first
    tl.fromTo(
      mainTitle,
      {
        opacity: 0,
        y: -20,
        scale: 0.95,
      },
      {
        opacity: 1,
        y: 0,
        scale: 1,
        duration: 0.5,
        stagger: 0.05,
      }
    );

    // Shadow title animation after main title
    tl.fromTo(
      shadowTitle,
      {
        opacity: 0,
        x: -10,
        y: -10,
      },
      {
        opacity: 0.8,
        x: 0,
        y: 0,
        duration: 0.8,
        stagger: 0,
      }
    );

    // Subtitle animation
